import React from 'react'
let dateNow = new Date();
let timeString = (dateNow.getDate()<10?'0'+dateNow.getDate():dateNow.getDate())+'-'+(dateNow.getMonth()+1<10?'0'+(dateNow.getMonth()+1):dateNow.getMonth()+1)+'-'+dateNow.getFullYear();
function data(dateNow){
    return timeString;
}


export default App;
